ator of attractiveness — though harmony is a key component of overall facial appeal.\"},{question:\"Why is my score lower or higher than I expected?\",answer:\"Chances are you mapped your landmarks incorrectly or used a poor-quality photo. Make sure to take proper front and side profile photos with good lighting, neutral expression, and correct angle. Watch our tutorial video to learn how to take the best photos and map your landmarks accurately.\"},{question:\"What's the best photo to take for an accurate score?\",answer:\"Take photos with even lighting, neutral expression, hair pulled back, and direct front/side angles. For detailed instructions, watch our tutorial video before starting your analysis.\"},{question:\"What if I'm confused about mapping a landmark?\",answer:\"No worries — we've included photo references and visual guides throughout the mapping process. These show you precisely where each landmark should be placed. If you're still unsure, you can join our support Discord channel and ask our community for help or feedback.\"},{question:\"How was the Harmony system built?\",answer:\"The Harmony system was initially developed by *Creating Attractive*, using an innovative method that combines data from hundreds of scientific research papers in cosmetic surgery and cephalometric analysis. He is now part of our team, and together we've further advanced the system to be more comprehensive, accurate, and complete — powered by more complex and refined algorithms.\"},{question:\"Will this account for differences in ethnicity?\",answer:\"Yes. FaceIQ Labs includes unique ideal ranges that account for ethnic variation, ensuring you're never penalized by a standard that doesn't represent your background. Each assessment adjusts for population-specific averages to maintain fairness and accuracy.\"},{question:\"Can I improve my score?\",answer:'Yes, absolutely. Harmony will soon include a dedicated \"Improvement\" section featuring personalized options to help you raise your score — including surgical and non-surgical approaches, cost ranges, timelines, and a customizable tracker so you can monitor your progress over time. You can even compare your results over time with our Compare Tool to track your improvements visually.'},{question:\"Can I share my results?\",answer:\"Of course! You're free to share your results and Harmony Score with your friends or on social media. Many users enjoy sharing their progress and discussing their results within the community.\"},{question:\"What if I have issues with payments or billing?\",answer:\"For payment or billing issues, please email us at support@faceiqlabs.com. We'll help resolve any problems with charges, refunds, or payment methods. You can also reach out on Discord for quicker communication, but email is preferred for payment-related matters.\"},{question:\"What if I need a receipt or have subscription questions?\",answer:\"Receipts are available in your dashboard under the Billing section in your profile. For subscription management or billing questions, please email us at support@faceiqlabs.com. We can help with subscription changes or answer questions about your plan. Discord is also available for faster responses, but email ensures we can securely handle your account information.\"},{question:\"What if I'm having technical issues or bugs?\",answer:\"If you encounter bugs, glitches, or technical problems, please report them on our Discord community for quick feedback and to help other users. For complex technical issues that require account investigation, you can also email us at support@faceiqlabs.com.\"},{question:\"What if I can't access my account?\",answer:\"Since we use Google authentication for login, if you're having trouble accessing your account, please ensure you're using the correct Google account. If you continue to have issues, email us at support@faceiqlabs.com with your account email address. We can help recover accounts or resolve access issues. Discord can also be used for quicker initial communication.\"},{question:\"What if I want to request a feature or provide feedback?\",answer:\"We'd love to hear your ideas! Join our Discord community to share feature requests and feedback with the team and other users. This is the best place for discussions and to see what others are requesting.\"},{question:\"What if I have privacy or data concerns?\",answer:\"For privacy concerns or questions about your data, please review our Privacy Policy page (linked above) for detailed information. For specific privacy-related questions or data deletion requests, please email us at privacy@faceiqlabs.com. We take privacy seriously and can address specific questions about data handling or privacy policy details.\"},{question:\"What if I have other questions?\",answer:\"You can join our support community on Discord for quick questions, general guidance, and to connect with others. For account-specific issues, payment matters, or anything requiring secure handling of personal information, please email us at support@faceiqlabs.com.\"}];function a({showHeader:e=!0,gridCols:a=\"4\"}){return(0,t.jsxs)(\"div\",{className:\"space-y-8\",children:[e&&(0,t.jsxs)(\"div\",{children:[(0,t.jsx)(\"h2\",{className:\"text-xl sm:text-2xl font-semibold\",children:\"Support & FAQs\"}),(0,t.jsx)(\"p\",{className:\"text-sm text-gray-600 mt-2\",children:\"Find answers to common questions about Harmony\"})]}),(0,t.jsxs)(\"div\",{className:`grid gap-4 ${\"4\"===a?\"sm:grid-cols-2 lg:grid-cols-4\":\"sm:grid-cols-2\"}`,children:[(0,t.jsxs)(\"a\",{href:\"https://discord.gg/vmqgmrry8q\",target:\"_blank\",rel:\"noopener noreferrer\",className:\"flex items-center gap-3 rounded-lg p-4 sm:p-6 transition-colors bg-blue-500 hover:bg-blue-600 text-white\",children:[(0,t.jsxs)(\"div\",{className:\"flex-1\",children:[(0,t.jsx)(\"h3\",{className:\"text-base font-medium\",children:\"Join our Discord Community\"}),(0,t.jsx)(\"p\",{className:\"text-sm text-blue-100 mt-1\",children:\"